def main(context):
    body = json.loads(context.req.body)
    context.log(body)
    
    location = body.get("location")
    if not location:
        return context.res.json({"ok": False, "error": "Location is required"})
    
    latitude, longitude = location.split(",")
    latitude = int(float(latitude) * 100)
    longitude = int(float(longitude) * 100)
    latitude_offset = latitude % 28
    longitude_offset = longitude % 28
    context.log(f"Latitude: {latitude}, Longitude: {longitude}")
    context.log(f"Latitude Offset: {latitude_offset}, Longitude Offset: {longitude_offset}")
    
    song = SONG_GRID[latitude_offset][longitude_offset]
    song_name = SONG_FILES_TO_NAMES[song]
    context.log(f"Song: {song}, Song Name: {song_name}")
    
    song_url = f"https://oldschool.runescape.wiki/images/transcoded/{song}/{song}.mp3"
    return context.res.json({"ok": True, "song_url": song_url, "song_name": song_name})